import React, {useState, useEffect} from "react";
import Pins from "./nyc_ttp_pins.json";

function App(){
    //const [pins, setPins] = useState([])
    console.log(Pins)
    console.log(Pins.[0].name)
    return(
        <div>
            {Pins.map(pin => (
                <li key={pin.id}>{pin.board.name}</li>
            ))}
        </div>
    )
}

export default App;
